INSERT INTO `articles` (`id`, `id_menu`, `id_auteur`, `titre`, `image`, `extrait`, `contenu`, `nb_vue`, `created_at`, `updated_at`) VALUES
(1, 5, 1, '﻿P\'IPO Championship : Treichville, Falcao, le top 4... , c\'est l\'heure du bilan', '', 'Le Maracana est l\'ami de tout bon Ivoirien. Pendant 3 mois, le P\'IPO National Cup s\'est déroulé parfaitement. Après des matchs disputés dans une parfaite ambiance, il est temps de faire le bilan. Le vainqueur, les qualifiés pour la Supercoupe....', '<h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><font face=\"Times New Roman\"><span style=\"font-weight: 700;\">Le Maracana est l\'ami de tout bon Ivoirien. Pendant 3 mois, le P\'IPO National Cup s\'est déroulé parfaitement. Après des matchs disputés dans une parfaite ambiance, il est temps de faire le bilan. Le vainqueur, les qualifiés pour la Supercoupe, les distinctions individuelles, résumons le P\'IPO.</span></font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><font face=\"Times New Roman\"><span style=\"font-weight: 700;\"><br></span></font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><font face=\"Times New Roman\">L\'unité autour de cet événement de Maracana a contribué à sa grande réussite. Après le top départ lancé le 17 avril passé à Sococe Cocody, le P\'IPO Championship a pris fin le dimanche dernier avec la victoire de Abobo (1-0) contre Yopougon. Cette belle initiative de Mr Tiemele a permis au public Abidjannais d\'encre découvrir de nouveaux talents.<br></font><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Sur le terrain, Treichville n\'a pas fait d\'amitié. Les hommes de Canavaro le Diamantaire ont terminé champions après une lutte acharnée contre son dauphin Yopougon. Les deux équipes sont d\'ailleurs qualifiées pour la Supercoupe qui se tiendra en août à Yamoussoukro.<br></font><font face=\"Times New Roman\">Quant à Cocody et Port Bouet, ils compléteront le duo en décembre prochain dans la même ville pour disputer le P\'IPO National Cup.<br></font><font face=\"Times New Roman\"><br></font><font face=\"Times New Roman\">Meilleure équipe du tournoi, Treichville a eu le mérite d\'offrir deux joueurs aux distinctions individuelles, Falcao meilleur buteur et Batigol meilleur joueur.</font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><font face=\"Times New Roman\"><br></font></h2>', '0', '2021-07-23 23:20:07', '2021-07-23 23:20:07');
INSERT INTO `articles` (`id`, `id_menu`, `id_auteur`, `titre`, `image`, `extrait`, `contenu`, `nb_vue`, `created_at`, `updated_at`) VALUES
(2, 5, 1, '﻿À la découverte de Daouda Bamba, le plus Norvégien des Ivoiriens', '', 'Les portes du P\'IPO sont désormais fermées. Le Maracana est l\'identité sportive Ivoirienne, Mr Tiemele en est conscient. Avec aussi de nombreux hommes de médias lors des rencontres, le Président du mouvement a fait passer un message, celui de voir ..', '<p><br></p><p><br></p><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\"><font face=\"Times New Roman, serif\"><span style=\"font-weight: 700;\">Le football est une leçon de vie pour de nombreuses personnes. Des rires au larmes, les émotions accompagnent tout acteur footballistique pendant son parcours. International Ivoirien, Souleymane Coulibaly fait partie de ces footballeurs aux parcours atypiques. Avec une carrière marquée de haut et de bas, le joueur de 26 ans est revenu&nbsp;sur sa saison, son parcours, les éléphants, ses ambitions et bien d’autres faits. Elogieux en vers son sélectionneur, fidèle au travail, lassé par certaines questions de la presse, le joueur passé par Tottenham dans sa jeunesse s’est confié longuement à Le Foot 225.</span></font><br><font face=\"Times New Roman, serif\"><br></font><font face=\"Times New Roman, serif\"><br></font><font face=\"Times New Roman, serif\"><span style=\"font-weight: 700;\">Comment juge</span><span style=\"font-weight: 700;\">s</span><span style=\"font-weight: 700;\">&nbsp;tu ta saison ?<br></span></font><font face=\"Times New Roman, serif\">J’ai passé une superbe saison saison collectivement et individuellement. Je pouvais marquer plus si j’avais pas manquer des matches quand j’étais en sélection. Je crois 2 ou 3 matches mais je suis satisfait de mes stats. 13 buts en toutes compétitions cette saison, finir meilleur buteur du club et 2ème meilleur en championnat, c’est bien.</font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\"><font face=\"Times New Roman, serif\"><br></font><font face=\"Times New Roman, serif\"><span style=\"font-weight: 700;\">Regrette</span><span style=\"font-weight: 700;\">s</span><span style=\"font-weight: 700;\">&nbsp;tu de ne pas avoir terminé champion ?<br></span></font><font face=\"Times New Roman, serif\">Oui j’ai un peu de regret mais aider mon équipe à finir 2ème et se qualifier en Ligue des Champions CAF est un objectif personnel atteint.</font><font face=\"Times New Roman, serif\"><br></font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\"><font face=\"Times New Roman, serif\"><br></font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\">&lt;blockquote class=\"twitter-tweet\"&gt;&lt;p lang=\"fr\" dir=\"ltr\"&gt;MEILLEUR JOUEUR DU P’IPO CHAMPIONSHIP ABIDJAN 2021.&lt;a href=\"https://twitter.com/hashtag/PIPO_CHAMPIONSHIP_ABIDJAN_2021?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#PIPO_CHAMPIONSHIP_ABIDJAN_2021&lt;/a&gt;&lt;a href=\"https://twitter.com/hashtag/PIPO?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#PIPO&lt;/a&gt;&lt;a href=\"https://twitter.com/hashtag/PIPO_NATIONAL_CUP?src=hash&amp;amp;ref_src=twsrc%5Etfw\"&gt;#PIPO_NATIONAL_CUP&lt;/a&gt; &lt;a href=\"https://t.co/hjb5BIRpEB\"&gt;pic.twitter.com/hjb5BIRpEB&lt;/a&gt;&lt;/p&gt;&amp;mdash; Le Foot 225 🇨🇮 (@LeFoot225) &lt;a href=\"https://twitter.com/LeFoot225/status/1417570253345800199?ref_src=twsrc%5Etfw\"&gt;July 20, 2021&lt;/a&gt;&lt;/blockquote&gt; &lt;script async src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"&gt;&lt;/script&gt;<font face=\"Times New Roman, serif\"><br></font></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\"><br></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 20px; margin-top: 0px; margin-bottom: 0cm; font-size: 20px;\"><font face=\"Times New Roman, serif\"><span style=\"font-weight: 700;\">Quel a été le meilleur moment de la saison ?<br></span></font><font face=\"Times New Roman, serif\">Le meilleur moment de ma saison a été avant ma sélection avec la Côte d’Ivoire car je marquais presque chaque 3 jours en club où j’avais même marqué 7 buts en 5 matches de suite. J’ai terminé meilleur joueur du mois et après ma sélection j’ai marqué un but très important qui a qualifié mon club en Ligue des Champions.</font><font face=\"Times New Roman, serif\"><br></font><font face=\"Times New Roman, serif\"><span style=\"font-weight: 700;\"><br>La concurrence au poste de l\'attaque t\'a t-elle boosté ?<br></span></font><font face=\"Times New Roman, serif\">Oui surtout quand tu sais que si tu ne marques pas dans 1 ou 2 matchs, l’autre va prendre ta place. Moi personnellement, ça me donne toujours la rage de redoubler mes efforts et être efficace devant la cage</font></h2><p><br></p>', '0', '2021-07-23 23:26:34', '2021-07-23 23:26:34');
INSERT INTO `articles` (`id`, `id_menu`, `id_auteur`, `titre`, `image`, `extrait`, `contenu`, `nb_vue`, `created_at`, `updated_at`) VALUES
(3, 5, 1, 'Jeux Olympiques Tokyo 2020 : Franck Kessié sélectionné avec les U23 ?', '', '﻿La sélection olympique de la Côte d\'Ivoire prendra part aux Jeux Olympiques dans moins d\'un mois. Attendue par tous les observateurs du football ivoirien, la liste des 18 sélectionnés se faire désirer. Pour le moment, aucun nom n\'a été communiqué...', '<h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"font-weight: 700;\">﻿La sélection olympique de la Côte d\'Ivoire prendra part aux Jeux Olympiques dans moins d\'un mois. Attendue par tous les observateurs du football ivoirien, la liste des 18 sélectionnés se faire désirer. Pour le moment, aucun nom n\'a été communiqué par Soualiho Haidara. Avec la possibilité d\'avoir trois Eléphants en A, Kessié serait parmi les convoqués à en croire un journaliste Italien.&nbsp;</span></span></h2><h2 style=\"text-align: center; font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/E6A4WvsDeLE\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"font-weight: 700;\"><br></span></span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC,&nbsp;</span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC,&nbsp;</span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC,&nbsp;</span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: &quot;Times New Roman&quot;;\">&nbsp;a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2>', '0', '2021-07-23 23:30:46', '2021-07-23 23:30:46');
