INSERT INTO `articles` (`id`, `id_menu`, `id_auteur`, `titre`, `image`, `extrait`, `contenu`, `nb_vue`, `created_at`, `updated_at`) VALUES
(6, 9, 1, 'Jeux Olympiques Tokyo 2020 : Franck Kessié sélectionné avec les U23 ?', '', '﻿La sélection olympique de la Côte d\'Ivoire prendra part aux Jeux Olympiques dans moins d\'un mois. Attendue par tous les observateurs du football ivoirien, la liste des 18 sélectionnés se faire désirer. Pour le moment, aucun nom n\'a été communiqué...', '<h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: \"Times New Roman\";\"><span style=\"font-weight: 700;\">﻿La sélection olympique de la Côte d\'Ivoire prendra part aux Jeux Olympiques dans moins d\'un mois. Attendue par tous les observateurs du football ivoirien, la liste des 18 sélectionnés se faire désirer. Pour le moment, aucun nom n\'a été communiqué par Soualiho Haidara. Avec la possibilité d\'avoir trois Eléphants en A, Kessié serait parmi les convoqués à en croire un journaliste Italien. </span></span></h2><h2 style=\"text-align: center; font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/E6A4WvsDeLE\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><span style=\"font-family: \"Times New Roman\";\"><span style=\"font-weight: 700;\"><br></span></span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: \"Times New Roman\";\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC, </span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: \"Times New Roman\";\"> a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: \"Times New Roman\";\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC, </span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: \"Times New Roman\";\"> a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2><h2 style=\"font-family: Oswald, sans-serif; font-weight: 500; line-height: 1.5em; margin-top: 0px; font-size: 20px;\"><span style=\"font-family: \"Times New Roman\";\">Les regards sont braqués sur Haidara ou encore Beaumelle. Les amateurs du sport roi attendent la liste pour avoir une idée de ceux qui défendront les couleurs nationales. Journaliste proche du Milan AC, </span><a href=\"https://twitter.com/AntoVitiello\" target=\"_blank\" style=\"background-color: rgb(0, 255, 0); color: rgb(1, 1, 1); text-decoration: none; transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\"><font color=\"#ff0000\">Antonio Vitielo</font></a><span style=\"font-family: \"Times New Roman\";\"> a laissé entendre sur son compte twitter que Franck Kessié avait été convoqué pour prendre part aux J.O.</span></h2>', '0', '2021-07-23 23:30:46', '2021-07-23 23:36:52');

